          adv.find('.parallax-content-wrap').css('overflow-y', 'hidden');
          btParallax.ePos = {
            'top': e.clientY,
            'left': e.clientX
          };
          btParallax.eSize = {
            'width': $(el).width(),
            'height': $(el).height()
          };
          adv.find('.nav-prev').addClass('prev-large');
          adv.find('.nav-next').addClass('next-large');
